from sympy import isprime
def a(n):
    s = str(n)
    out = set(s[:i]+c+s[i:] for i in range(len(s)+1) for c in "0123456789")
    out = sorted(int(k) for k in out if k[0] != "0")
    ptest = (i for i, k in enumerate(sorted(out), 1) if isprime(int(k)))
    return next(ptest, 0)
